import './App.css'
import './assets/styles/global.scss'
import Header from "./components/Header";
import Home from './pages/Homepage';
import {Route} from 'react-router'
import {Routes} from 'react-router-dom'
function App() {
  return (
    <Routes>
      <Route>
      <div>
      <Header></Header>
      <Home></Home>
    </div>
      </Route>
    </Routes>
  );
}

export default App;
